import React, { useState } from "react";

function TrustRafeeq() {
  const [clickCount, setClickCount] = useState(0);

  const handleClick = () => {
    setClickCount(clickCount + 1); // زيادة العدد عند النقر
  };

  return (
    <div onClick={handleClick} style={styles.card}>
      <h2>Trust Rafeeq</h2>
      <p>Number of clicks: {clickCount}</p>
    </div>
  );
}

const styles = {
  card: {
    border: "1px solid #ccc",
    padding: "20px",
    borderRadius: "10px",
    cursor: "pointer",
    textAlign: "center",
    width: "200px",
    margin: "20px auto",
  },
};

export default TrustRafeeq;
